import React, { Component } from "react";

class Dashboard extends Component {
      render() {
            return (
                  <>
                        <div className="dashboard"> 
                        <button type="button" class="btn-close" aria-label="Close"></button>
                        </div>
                  </>
            );
      }
}

export default Dashboard;
